Given the following program and the specified variable, optimize it out by constant propagation or copy propagation. If this variable is unused, just optimize it out.. The program is trait TypeVal<d> {
    const c: d;
}
struct Five;
struct b<e, f> {
    h: g,
}
impl<e, f> TypeVal<usize> for b<e, f> where e: TypeVal<c> {}
fn main() {
    [1; b::<Five, Five>::c];
}
.                 The target to be optimized is c.
